import React, { Component } from 'react';

class Contents extends Component {

  constructor(props) {
    super(props);
    this.state = { loggedInUser: null };
    this.service = new AuthService();
  }
  render() {
    return (<div>{this.state.loggedInUser.username}
         </div>);

  }
}

export default Contents;
